import React, { Component } from 'react'
import axios from 'axios'
import { Link } from "react-router-dom";
import { Grid } from '@material-ui/core';
import './css/Home.css'

export default class Servicios extends Component {
    state = {
        reg: []
    }

    componentDidMount() {
        axios.get('http://localhost:3001/regiones')
            .then(res => {
                const reg = res.data;
                this.setState({ reg });
            })
    }

    render() {
        const { reg } = this.state
        const styles = [
            {
                text: "hola1",
                css: {
                    left: '142px',
                    top: '101px'
                }
            },
            {
                text: "hola2",
                css: {
                    left: '146px',
                    top: '152px'
                }
            },
        ]


        const numbers = ["hola1", 2, 3, 4, 5];


        return (
            <div className="contenedoPronGeneral">
                {reg.map((item) => {
                    return (
                            <div key={item.region_id} >
                            <Link to={"/region/" + item.region_id} >
                                <img
                                    className='regionesChile'
                                    src={item.img}
                                    alt={item.region}
                                    style={item.position}
                                 />
                            </Link> 
                        </div>
                    )
                })}
                <h1>{numbers[0]}</h1>
            </div>
        )
    }
}
